import React, { Component } from 'react'
import { Card } from 'antd';
 class Coursesps extends Component {
    render() {
        return (
            <div>
                <Card className="" bordered={true} style={{ width: 300 }}>
                    <p>Card content</p>
                    <p>Card content</p>
                    <p>Card content</p>
                </Card>
            </div>
        )
    }
}

export default Coursesps
